  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tewaukon National
  Wildlife Refuge summarizes refuge activities from September through December of
  1959.  The report begins with a summary of the weather and habitat conditions during
  this period.  Wildlife- including migratory birds, upland game birds, big game animals,
  fur animals, predators, rodents, other mammals, predacious birds, and fish- is also
  covered.  The report includes a refuge development and maintenance section which
  discusses physical development, plantings, collections, receipts, and control of
  vegetation.  Resources management is outlined; haying, fur harvest, and commercial
  fishing were the primary economic uses of the refuge during this period.  A progress
  report on field investigation and applied research is also provided.  The public
  relations section of the report discusses recreational uses of the refuge, refuge
  visitors, refuge participation, hunting, and violations.  Finally, items of interest,
  photographs, information on easements and WPAs, and N-R forms are provided.\",\n\t\"license_title\":
